// src/Skills.js
import React from 'react';

function Skills() {
    return (
        <section className="skills">
            <h2>TECHNICAL SKILLS:</h2>
            <ul>
                <li>Domain: Banking (Finacle Core Banking Solution) </li>
                        <li>Platform/OS: UNIX </li>
                        <li> Languages: SQL, PL/SQL</li>
                        <li> Scripting Languages: Finacle Scripting, Java Script</li>
                        <li> Tools: Oracle SQL, IReport (Jasper Report)</li>
                {/* Add more skills as needed */}
            </ul>
        </section>
    );
}

export default Skills;
